import { Helmet } from "react-helmet";

export function Push() {

    return (

        <>
            <Helmet>
                <title>I'm Helmet</title>

                <script src="https://js.pusher.com/7.2/pusher.min.js"></script>
                <script>
                const Pusher = window.pusher
                    Pusher.logToConsole = true;


                </script>

            </Helmet>
        </>
    );
}
